import React, { Component, useState, useEffect } from 'react';
import { View, Text, SafeAreaView, StyleSheet, ScrollView, ActivityIndicator } from 'react-native';
import AsyncStorage from '@react-native-community/async-storage';
import Axios from 'axios';
import { Card, ListItem, Button, Icon } from 'react-native-elements'
import Loader from './loader';

export default class Userprofiles extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [],
            profiles: [],
            testdatas: '',
            userstory: [],
            activeSections: [],
            isLoading: false
        }
    }
    getprofiles = async () => {
        try {
            let users = await AsyncStorage.getItem('userdatas');
            const userdatas = JSON.parse(users);
            console.log(userdatas);
            this.setState({ data: userdatas });
            const gettoken = this.state.data.token;
            const getuserid = this.state.data.userid;
            console.log(gettoken);
            const localurl = 'http://192.168.1.16:8000/api/getuserdetails/';
            const config = {
                headers: {
                    'content-type': 'multipart/form-data',
                    'Authorization': 'Bearer ' + gettoken,
                    'Accept': 'application/json',
                },

            };
            Axios.get(localurl + getuserid, config)
                .then(response => {
                    this.setState({ profiles: response.data.profile });
                })
                .catch(function (error) {
                    console.log(error);
                })
        }
        catch (e) {
            console.log(e);
        }
    }
    render() {
        return (
            <SafeAreaView style={{ flex: 1 }}>
                <ScrollView>
                    <View>
                        <Text>Profile details will comes here</Text>
                    </View>
                </ScrollView>
            </SafeAreaView>
        )
    }

}

const styles = StyleSheet.create({
    storycontentbottomview: {
        paddingBottom: 50,
        textAlign: 'justify'
    },
    mainBody: {
        paddingBottom: 50
    },
    activityIndicator: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        height: 80
    },
    underline: { textDecorationLine: 'underline' }

});
